       Axios.get('https://maps.googleapis.com/maps/api/geocode/json?address="c/51,harikrupa society nikol gam road ahmedabad gujarat"&key=AIzaSyDv1GqR3Il2642Oli_Z74eIZRUDZ3Wl1GM')
       .then(data => console.log(data));
       
    }, [])
//     https://maps.googleapis.com/maps/api/geocode/json?address=1600+Amphitheatre+Parkway,
